import NInput from "./NInput";
import {useState} from "react";
import {Text} from "react-native-web";

export default function UIView() {
    const [n, setN] = useState();
    const onStart = (n) => {
      setN(n)
    }
    return n > 0 ? <Text>{n}</Text> : <NInput onStart={onStart}></NInput>;
}
